O ano já começou com muitos desafios, mas nós estamos prontos e dispostos para enfrentá-los.

Para os primeiros meses de 2022 determinei a dedicação exclusiva em algumas pautas para o nosso município que vão desde obras a confecção de importantes projetos de leis e decretos para o bom andamento da administração pública municipal, entre eles:

✅ Reforma da Avenida Francisco Rodrigues da Silva, a "Avenida da Caminhada", já em andamento;

✅ Reforma de todos os PSF's (unidades de saúde), já em andamento o projeto;

✅ Reforma da Escola Municipal São Geraldo, no bairro rural São Bento, já em andamento;

✅ Construção do Complexo Esportivo "Gabriel e Rafael", no bairro Vila Betânia;

✅ Reforma da entrada do Estádio Benevenuto Augusto de Souza, no CEA, e a construção de novos banheiros, bem como a construção de uma cabine de transmissão para jogos;

 ✅ Reforma das quadras da Exposição, do São Bento e uma localizada dentro do "Campo do CEA";

✅ Canalização do córrego que corta o bairro Santos Reis que compreende entre a rua Dona Indá e a rua Mário Gonçalves da Silveira;

✅ Iluminação do Trevo de Alpinópolis, da rua Assad Agege no bairro Panorama e da rua José Veríssimo, no bairro Vila Betânia;

✅ Recapeamento das ruas Belo Horizonte, Bahia e Rio de Janeiro no bairro Mundo Novo, ruas Ametista, Rubi, Topázio e Turmalina, no bairro Santa Efigênia, rua Alferes José Justiniano dos Reis, no bairro Vila Betânia, calçamento das ruas Abraão Nassor, no bairro Santos Reis, Travessa Treze de Maio, no bairro São Benedito, na rua Evaristo Alves da Cruz, no bairro Ubirajara Cabral, entre outras ruas do município;

✅ Continuação do Programa Morada Digna, das casas populares, após aprovação da Câmara;

✅ Inauguração do Britador Municipal e da compra de novos maquinários;

✅ Nova licitação para o tratamento da água e do esgoto de Alpinópolis;

✅ Projeto de lei que amplia e cria novos auxílios sociais para famílias carentes do município;

✅ Decreto que institui o novo valor das diárias dos motoristas da prefeitura, uma reinvindicação antiga da categoria, já atendida; 

✅ Revisão do Plano de Carreira dos Servidores Municipais, reajuste salarial, criação de um abono e do vale refeição para os servidores efetivos e de processo seletivo do município, entre outros.

A lista é grande. Citei alguns dos nossos projetos. 🚀

